Here is my attempt at drawing a vertically flipped line and guitar in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw vertically flipped line
  int lineY = height - 1;
  line(0, lineY, width, lineY);

  // Draw vertically flipped guitar
  // Body
  int bodyWidth = 100;
  int bodyHeight = 200;
  int bodyX = 150;
  int bodyY = height - bodyHeight;
  rect(bodyX, bodyY, bodyWidth, bodyHeight);

  // Neck
  int neckWidth = 30;
  int neckHeight = 100;
  int neckX = bodyX + bodyWidth/2 - neckWidth/2;
  int neckY = bodyY - neckHeight;
  rect(neckX, neckY, neckWidth, neckHeight);

  // Head
  int headWidth = 50;
  int headHeight = 70;
  int headX = neckX + neckWidth/2 - headWidth/2;
  int headY = neckY - headHeight;
  ellipse(headX, headY, headWidth, headHeight);

  // Bridge
  int bridgeWidth = 20;
  int bridgeHeight = 30;
  int bridgeX = bodyX + 10;
  int bridgeY = bodyY - bridgeHeight - 10;
  rect(bridgeX, bridgeY, bridgeWidth, bridgeHeight);

  // Sound hole
  int soundHoleX = bodyX + bodyWidth/2 - 15;
  int soundHoleY = bodyY + bodyHeight/2 - 15;
  ellipse(soundHoleX, soundHoleY, 30, 30);

  // Strings
  int stringSpacing = 20;
  int firstStringY = bridgeY - stringSpacing;
  for (int i = 0; i < 6; i++) {
    line(bridgeX, firstStringY + i*stringSpacing, neckX + neckWidth, firstStringY + i*stringSpacing);
  }
}
```

Here is my attempt at drawing a vertically flipped line and headphone in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw vertically flipped line
  int lineY = height - 1;
  line(0, lineY, width, lineY);

  // Draw vertically flipped headphone
  // Headband
  int headbandWidth = 150;
  int headbandHeight = 20;
  int headbandY = height - headbandHeight - 30;
  rect(width/2 - headbandWidth/2, headbandY, headbandWidth, headbandHeight);

  // Ear pads
  int earPadDiameter = 50;
  int earPadY = headbandY - earPadDiameter - 10;
  ellipse(width/2 - earPadDiameter*1.5, earPadY, earPadDiameter, earPadDiameter);
  ellipse(width/2 + earPadDiameter*0.5, earPadY, earPadDiameter, earPadDiameter);

  // Headphone speakers
  int speakerWidth = 30;
  int speakerHeight = 60;
  int speakerY = earPadY - speakerHeight - 20;
  rect(width/2 - speakerWidth - 20, speakerY, speakerWidth, speakerHeight);
  rect(width/2 + 20, speakerY, speakerWidth, speakerHeight);

  // Headphone wire
  int wireY1 = speakerY - 20;
  int wireY2 = height - 30;
  line(width/2, wireY1, width/2, wireY2);
}
```

