Here is my attempt at drawing a vertically flipped line and microphone in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw vertically flipped line
  int lineY = height;
  line(0, lineY, width, lineY);

  // Draw vertically flipped microphone
  // Microphone stand
  int standHeight = 150;
  int standWidth = 20;
  int standX = width/2 - standWidth/2;
  int standY = height - standHeight;
  rect(standX, standY, standWidth, standHeight);

  // Microphone head
  int headDiameter = 100;
  int headX = width/2;
  int headY = standY - headDiameter;
  ellipse(headX, headY, headDiameter, headDiameter);

  // Microphone grill
  int grillSpacing = 20;
  int numGrills = headDiameter / grillSpacing;
  for (int i = 0; i < numGrills; i++) {
    int grillX = headX - headDiameter/2 + i*grillSpacing;
    line(grillX, headY, grillX, headY + grillSpacing);
  }

  // Microphone handle
  int handleHeight = 50;
  int handleWidth = 10;
  int handleX = width/2 - handleWidth/2;
  int handleY = headY - handleHeight;
  rect(handleX, handleY, handleWidth, handleHeight);
}
```

This draws a line at the bottom of the canvas to represent a vertically flipped line at the top. It then draws a microphone stand, microphone head, microphone grill, and microphone handle to represent a vertically flipped microphone in the middle. Let me know if you would like me to explain or clarify any part of the code.

Here is my attempt at drawing a vertically flipped line and trumpet in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw vertically flipped line
  int lineY = height;
  line(0, lineY, width, lineY);

  // Draw vertically flipped trumpet
  // Trumpet mouthpiece
  fill(255, 204, 0);
  ellipse(width/2, height-50, 30, 30);

  // Trumpet valves
  fill(0);
  ellipse(width/2-20, height-100, 10, 10);
  ellipse(width/2, height-100, 10, 10);
  ellipse(width/2+20, height-100, 10, 10);

  // Trumpet tubing
  stroke(0);
  line(width/2-20, height-100, width/2-50, height-150);
  line(width/2, height-100, width/2-20, height-150);
  line(width/2+20, height-100, width/2+50, height-150);

  // Trumpet bell
  noFill();
  stroke(0);
  arc(width/2, height-200, 100, 100, PI, TWO_PI);

  // Trumpet valves to tubing
  line(width/2-20, height-100, width/2-50, height-120);
  line(width/2, height-100, width/2-20, height-120);
  line(width/2+20, height-100, width/2+50, height-120);
}
```

This draws a line at the bottom of the canvas and a trumpet in the middle with its mouthpiece at the top, valves in the middle, tubing extending downwards, and bell at the bottom - representing a vertically flipped image of a trumpet with a line at the top. Let me know if you would like me to clarify or expand on any part of this code.

