Here is my attempt at drawing a vertically flipped line and mountain in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw the vertically flipped line
  int lineY = height - 50;  // The y position of the line is the height minus 50
  stroke(0);
  line(0, lineY, width, lineY);

  // Draw the vertically flipped mountain
  // Define variables for the mountain
  int mountainPeakX = width/2;  // The x position of the mountain peak is the width divided by 2
  int mountainPeakY = height/2; // The y position of the mountain peak is the height divided by 2
  int mountainBaseWidth = 150;  // The base width of the mountain
  int mountainSlope = 75;       // The slope of the mountain sides

  // Draw the mountain peak
  fill(0);
  ellipse(mountainPeakX, mountainPeakY, 20, 20);

  // Draw the left side of the mountain
  int leftSideX = mountainPeakX - mountainBaseWidth; // The x start position of the left side
  int leftSideY = mountainPeakY;                    // The y start position of the left side
  for (int i = 0; i < mountainSlope; i++) {         // Draw the left side slope line by line
    leftSideX -= 1;                                // Decrease the x position by 1 for each line
    leftSideY += 1;                                // Increase the y position by 1 for each line
    line(leftSideX, leftSideY, leftSideX, height - leftSideY);  // Draw a line and its vertically flipped line
  }

  // Draw the right side of the mountain
  int rightSideX = mountainPeakX + mountainBaseWidth; // The x start position of the right side
  int rightSideY = mountainPeakY;                     // The y start position of the right side
  for (int i = 0; i < mountainSlope; i++) {           // Draw the right side slope line by line
    rightSideX += 1;                                 // Increase the x position by 1 for each line
    rightSideY += 1;                                 // Increase the y position by 1 for each line
    line(rightSideX, rightSideY, rightSideX, height - rightSideY); // Draw a line and its vertically flipped line
  }
}
```

