Here is my attempt at drawing a vertically flipped line and mouse in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw the vertically flipped line
  int lineY = height - 1;  // Start from the bottom of the canvas
  int lineHeight = 30;     // Height of the line

  for (int i = 0; i < lineHeight; i++) {
    set(0, lineY - i, 0);  // Set a black pixel at (x, y)
  }

  // Draw the vertically flipped mouse
  // Body
  int bodyHeight = 50;
  int bodyWidth = 100;
  int bodyY = height - bodyHeight - 10;  // 10 pixels margin from the bottom
  int bodyX = width/2 - bodyWidth/2;     // Centered horizontally

  for (int i = 0; i < bodyHeight; i++) {
    for (int j = 0; j < bodyWidth; j++) {
      set(bodyX + j, bodyY - i, 0);  // Set black pixels for the body
    }
  }

  // Head
  int headDiameter = 50;
  int headY = bodyY - headDiameter - 10;  // 10 pixels above the body
  int headX = width/2 - headDiameter/2;   // Centered horizontally

  for (int i = 0; i < headDiameter; i++) {
    for (int j = 0; j < headDiameter; j++) {
      // Check if the pixel is within a circle with diameter = headDiameter
      if (dist(headX + j, headY - i, headX + headDiameter/2, headY - headDiameter/2) < headDiameter/2) {
        set(headX + j, headY - i, 0);  // Set black pixel for the head
      }
    }
  }

  // Ears
  int earHeight = 20;
  int earWidth = 10;
  int earY = headY - earHeight - 10;  // 10 pixels above the head
  int earX = headX - earWidth - 10;   // 10 pixels to the left of the head

  for (int i = 0; i < earHeight; i++) {
    for (int j = 0; j < earWidth; j++) {
      set(earX + j, earY - i, 0);  // Left ear
    }
  }

  earX = headX + headDiameter + 10;  // 10 pixels to the right of the head
  for (int i = 0; i < earHeight; i++) {
    for (int j = 0; j < earWidth; j++) {
      set(earX + j, earY - i, 0);  // Right ear
    }
  }
}
```

Here is my attempt at drawing a vertically flipped line and mushroom in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw the vertically flipped line
  int lineY = height - 1;  // Start from the bottom of the canvas
  int lineHeight = 30;     // Height of the line

  for (int i = 0; i < lineHeight; i++) {
    set(0, lineY - i, color(0));  // Set a black pixel at (x, y)
  }

  // Draw the vertically flipped mushroom
  // Stem
  int stemHeight = 70;
  int stemWidth = 10;
  int stemX = width/2 - stemWidth/2;
  int stemY = height - stemHeight;

  for (int i = 0; i < stemHeight; i++) {
    for (int j = 0; j < stemWidth; j++) {
      set(stemX + j, stemY - i, color(139,69,19));  // Brown color
    }
  }

  // Cap
  int capHeight = 100;
  int capWidth = 200;
  int capX = width/2 - capWidth/2;
  int capY = height - capHeight - stemHeight; 

  // Curve for the cap
  float cx = capX + capWidth/2;
  float cy = capY + capHeight/2;
  float r = capWidth/2;

  for (float theta = 0; theta < PI; theta += 0.01) {
    float x = cx + r * cos(theta);
    float y = cy + r * sin(theta);
    set((int)x, (int)(height - y), color(255, 0, 0));  // Red color
  }

  // Dots
  int dotRadius = 6;
  int dotX1 = capX + 50;
  int dotY1 = height - (capY + 30);
  int dotX2 = capX + 150;
  int dotY2 = height - (capY + 50);

  for (int i = 0; i < dotRadius*2; i++) {
    for (int j = 0; j < dotRadius*2; j++) {
      if (dist(i, j, dotRadius, dotRadius) < dotRadius) {
        set(dotX1 + i, dotY1 - j, color(0));
        set(dotX2 + i, dotY2 - j, color(0));  
      }
    }
  }
}
```

