Here is my attempt at drawing a vertically flipped line and apple in Processing without using any built-in transformation functions:

```processing
void setup() {
  size(400, 400);
  background(255);
}

void draw() {
  // Draw the vertically flipped line
  int lineY = height - 1;  // Start from the bottom of the canvas
  int lineHeight = 30;     // Height of the line

  for (int i = 0; i < lineHeight; i++) {
    set(0, lineY - i, color(0));  // Set a black pixel at (x, y)
  }

  // Draw the vertically flipped apple
  int appleX = width/2;     // Center the apple horizontally
  int appleY = height - 65; // Start from 65 pixels above the bottom
  int appleDiameter = 50;   // Diameter of the apple

  // Draw the apple's circle
  for (int i = 0; i < appleDiameter; i++) {
    float angle = radians(i * (360/appleDiameter));
    int x = appleX + cos(angle) * i;
    int y = appleY + sin(angle) * i;
    set(x, y, color(255, 0, 0));  // Set a red pixel at (x, y)
  }

  // Draw the apple's stem
  int stemX = appleX;
  int stemY = appleY - 20;
  int stemHeight = 20;
  int stemWidth = 5;

  for (int i = 0; i < stemHeight; i++) {
    for (int j = 0; j < stemWidth; j++) {
      set(stemX + j, stemY - i, color(139, 69, 19));  // Brown color
    }
  }

  // Draw the apple's leaf
  int leafX = stemX - 10;
  int leafY = stemY - stemHeight - 10;
  int leafSize = 20;

  for (int i = 0; i < leafSize; i++) {
    float angle = radians(i * (360/leafSize));
    int x = leafX + cos(angle) * i;
    int y = leafY + sin(angle) * i;
    set(x, y, color(0, 100, 0));  // Green color
  }
}
```

